    [],nt"revision_timestamp": "2016-07-27T22:57:12.134967",nt"name": "nesting-loggerhead-sea-turtle-activity-report-1999",nt"isopen":
    false,nt"url": null,nt"notes": "This paper presents results from the seventh
    annual study (using Army Corp of Engineers funds;) of nesting along the Atlantic
    Ocean coastline by the loggerhead sea turtle (Caretta caretta) in Virginia Beach,
    Virginia during 1999. All surveys were carried out by staff of the Back Bay National
    Wildlife Refuge, Virginia Beach, Virginia, throughout the sea turtle nesting season.
    Two seasonal, full-time biological technicians were hired through funding support
    from the U.S. Army Corps of Engineers, Norfolk, Virginia, to search twenty-five
    miles of beach along the northern periphery of the nesting range of the Loggerhead.
    Refuge biologists investigated nine nesting attempts during 1999. Of the nine nesting
    attempts, only two were actual nests. Seven were false crawls; of which four were
    unsuccessful nesting attempts.",nt"license_title": "License Not Specified",nt"extras":
